const stateDefault = {
    todo: [
        {content:"dắt chó",status:false}
    ]   
}

export const ToDoReducer = (state = stateDefault, action)=>{
    switch(action.type){
        case "todoDispatch": {
            const {content} = action.todo;
            console.log(action)
            return {...state}
        }
        default: return {...state}
    }
}
